import React from "react";
import Ninjas from "./Ninjas";

function App() {
  return (
    <div className="App">
      <h1>Tis working!</h1>
      <Ninjas name="nihar" age="dsf"></Ninjas>
      <Ninjas name="dgfsdf" age="asfdas"></Ninjas>
    </div>
  );
}

export default App;
